			notifications.sendNotificationFromCurrentUser(recipients, notificationText, document, true);
		}

		var responseToAssoc = document.associations["fms-outgoing:response-to-assoc"];
		if (responseToAssoc){
			var incoming = responseToAssoc[0];
			documentConnection.createConnection(document, incoming, "inResponseTo", true);
			var incomingRegNumber = incoming.properties["lecm-document:regnum"];
			document.properties["fms-outgoing:incoming-number"] = incomingRegNumber;
			document.save();
		}
}

