var document = bpm_package.children[0];
if (document != null) {
  lecmPermission.revokeDynamicRole(document, 'DA_POTENTIAL_NORMCONTROLLER_DYN');
  lecmPermission.revokeDynamicRole(document, 'DA_NORMCONTROLLER_DYN');
  var potentialControllers = [];
  if (document.assocs["fms-norms-control-ts:table-assoc"] != null) {
    var tableData = document.assocs["fms-norms-control-ts:table-assoc"][0];
    if (tableData != null) {
      var tableRows = documentTables.getTableDataRows(tableData.nodeRef.toString());
      if (tableRows != null) {
        for (var i = 0; i < tableRows.length; i++) {
          var row = tableRows[i];
          if (row.assocs["fms-norms-control-ts:controller-assoc"] != null) {
            var result = row.properties["fms-norms-control-ts:result"];
            var normController = row.assocs["fms-norms-control-ts:controller-assoc"][0];
            if ((result == null || result.length == 0) && normController != null) {
              potentialControllers.push(normController);
            }
          }
        }
      }
    }
  }
  if (potentialControllers.length == 0) {
    var primaryUnit = orgstructure.getPrimaryOrgUnit(orgstructure.getCurrentEmployee());
    if (primaryUnit != null) {
      var potentialWorkers = edsGlobalSettings.getPotentialWorkers("DA_NORMCONTROLLER", primaryUnit);
      if (potentialWorkers != null) {
        potentialControllers = potentialWorkers;
      }
    }
  }
  if (potentialControllers.length > 0) {
    for (var i = 0; i < potentialControllers.length; i++) {
      statemachine.grandDynamicRoleForEmployee(document, potentialControllers[i], "DA_POTENTIAL_NORMCONTROLLER_DYN", task);
    }
    var notificationText = "Вам поступил документ ";
    notificationText += documentScript.wrapperDocumentLink(document, "{lecm-document:ext-present-string}");
    notificationText += " на нормоконтроль";
    notifications.sendNotificationFromCurrentUser(potentialControllers, notificationText, document, true);
  }
  document.properties["fms-norms-control-ts:performed"] = false;
  document.save();
}

