(function(){
	var ContextLoader = Packages.org.springframework.web.context.ContextLoader;
	var context = ContextLoader.getCurrentWebApplicationContext();
	var fmsApprovalWorkflowService = context.getBean('fmsApprovalServiceImpl');
	var fmsSigningService = context.getBean('fmsSigningServiceImpl');

	var runNext = stm_document.properties['lecm-approval-aspects:startNext'];
	var runApproval = fmsApprovalWorkflowService.isApproveActionAvailable(stm_document.nodeRef) &&
        stm_document.properties['fms-aspects:external'] === false;

	var runSigning = fmsSigningService.isSigningListContainsItems(stm_document.nodeRef) &&
        stm_document.properties['lecm-signing-aspects:signing-status'] != "FINISHED_SUCCESS" &&
        stm_document.properties['lecm-signing-aspects:signing-status'] != "IN_PROCESS" &&
		stm_document.properties['fms-aspects:external'] === false;

	if (runNext) {
		var jsonUtils = new Packages.org.springframework.extensions.webscripts.json.JSONUtils(),
            documentType = "" + stm_document.typeShort, //для того чтобы java.lang.String превратился в js native string
			variables;
        if (runApproval) {
			//запуск подписания по маршруту
            variables = jsonUtils.toJSONObject({
                workflowRole: "DA_APPROVERS",
                workflowDynRole: "DA_APPROVER_DYN",
                workflowDefinition: "fmsApproval",
                documentRef: stm_document.nodeRef,
                runAsEmployee: stm_document.assocs["fms-aspects:executor-assoc"][0].nodeRef
			});
                routeWorkflow.startWorkflow(variables);
		} else if ( runSigning ) {
            //запуск подписания по маршруту
            variables = jsonUtils.toJSONObject({
                workflowRole: "DA_SIGNERS",
                workflowDynRole: "DA_SIGNER_DYN",
                workflowDefinition: "fmsSign",
                documentRef: stm_document.nodeRef,
                runAsEmployee: stm_document.assocs["fms-aspects:executor-assoc"][0].nodeRef
			});
                routeWorkflow.startWorkflow(variables);
		}
	}
})();

