(function(){
  var document = bpm_package.children[0];
  if (document != null) {
    if (statemachine.getPreviousStatusName(document)!=="На регистрации") {
      var externalTrue = document.properties["fms-aspects:external"];
      if (externalTrue){
        var lastSigner = outgoing.getExternalLastSigner(document.getNodeRef());
        if (lastSigner){
          document.createAssociation(lastSigner,"lecm-signing-aspects:previosly-signed-by-assoc");
          document.save();
        }
      }

      document.properties["fms-outgoing:regnum-prefix"] = outgoing.getRegNumPrefix(document.getNodeRef());
      document.save();

      //получение списка регистраторов
      var registrars = orgstructure.getEmployeesByBusinessRoleId('OUTGOING_REGISTRARS', true);
      var recipients = [];
      for (i = 0; i < registrars.length; ++i) {
        statemachine.grandDynamicRoleForEmployee(document, registrars[i], 'DA_REGISTRAR_DYN', task);
        recipients.push(registrars[i].getNodeRef().toString());
      }

      var executor = document.assocs["fms-aspects:executor-assoc"][0];
      var notificationText = "Документ " + documentScript.wrapperDocumentLink(document, '{lecm-eds-document:summaryContent}');
      notificationText += ", Исполнитель: " + documentScript.wrapperLink(executor, executor.properties["lecm-orgstr:employee-short-name"]);
      notificationText += " поступил  на регистрацию";

      notifications.sendNotificationFromCurrentUser(recipients, notificationText, document, true);
    }
  }

})();

